import React from 'react';
import './App.css';
import Layout from './components/Layout/Layout';
import {BrowserRouter, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <BrowserRouter>
      <Layout/>
    </BrowserRouter>
    </div>
  );
}

export default App;
